const RoomNum = (props) => {
    console.log(props.total);
    var list = [];
    for (var i = 1; i <= props.total; i++) {
      list.push(i);
    }
  return (  
    <div>

    {list.map(function(i){
        return (<div key={i}>
            <span>Room{i}</span>
            <br></br>
            <span>Adults</span>
            <input type="number" min="0" width="10px"/>
            <span>childs</span>
            <input type="number" min="0" width="5"/>

        </div>)
    })}


    </div>
  );
};
export default RoomNum;
